import React from "react";
// import { Link } from "react-router-dom";
import logoImg from "../../../img/logo.png";

export default function Header() {
  return (
    <div>
      <header className="flex w-full bg-white p-2">
        <div className="mx-4">
          <img src={logoImg} alt="" className="2-8 h-8" />
        </div>
        <form action="" className="bg-reddit_gray-800 p-1 flex rounded-md">
          <svg
            xmlns="http://www.w3.org/2000/svg"
            viewBox="0 0 24 24"
            fill="currentColor"
            className="text-gray-300 h-7"
          >
            <path
              fillRule="evenodd"
              d="M10.5 3.75a6.75 6.75 0 100 13.5 6.75 6.75 0 000-13.5zM2.25 10.5a8.25 8.25 0 1114.59 5.28l4.69 4.69a.75.75 0 11-1.06 1.06l-4.69-4.69A8.25 8.25 0 012.25 10.5z"
              clipRule="evenodd"
            />
          </svg>
          <MagnifyingGlassIcon />
          <input type="text" className="bg-reddit_light_gray h-6" />
        </form>
      </header>
    </div>
    // <div className={styles.header}>
    //   <div className={styles.contents}>
    //     <div className={styles.logo}>
    //       <img src={logoImg} alt="React" className="App-logo"></img>Reddit
    //     </div>
    //     <nav className={styles.navigation}>
    //       <ul className={styles.ul}>
    //         <li className={styles.ul}>
    //           <Link to="/login">
    //             <button className={styles.button}>Log In</button>
    //           </Link>
    //         </li>
    //         <li className={styles.li}>
    //           <i className="fa-regular fa-user"></i>
    //         </li>
    //       </ul>
    //     </nav>
    //   </div>
    // </div>
  );
}
